import React from 'react';

class Filter extends React.Component {
    constructor (props) {
        super (props);
    }

    componentDidMount () {
        // console.log("Props ====>", this.props);
    }

    render () {
        console.log("Props ====>", this.props.data);
        return (
            <div>
                <ul>
                    `{this.props[1].map(filter => (
                    <li>
                        <input type="checkbox" />
                        <label className="desc-value">{filter}</label>
                    </li>
                ))}`
                </ul>
            </div>
        )
    }
}

export default Filter;
